import React from 'react';

const Header = () => {
  return (
    <div className="header">
      <ul>
        <li><h3>YogaInternational</h3></li>
        <li><a href="#">CLASSES</a></li>
        <li><a href="#">LEARN</a></li>
        <li><a href="#">COURSES</a></li>
      </ul>
    </div>
  )
}

export default Header;
